  'txtAboutAppAns1': "మీకు అవసరమైన విధంగా మీరు మీ రోజువారీ వ్యాయామాలను పునరావృతం చేయవచ్చు. ప్రారంభకులకు, మీరు రోజుకు ఒకసారి, వారానికి 2-3 సున్నాలను వ్యాయామం చేయాలని మేము సూచిస్తున్నాము. అనుభవజ్ఞులైన వినియోగదారుల కోసం, మీకు అవసరమైనట్లుగా రోజుకు ఒకసారి లేదా చాలా సార్లు వ్యాయామం చేయవచ్చు.\n\nఅన్ని వ్యాయామాలను నిపుణులు రూపొందించారు, ఇది ప్రతి ఒక్కరికీ, టీనేజ్ మరియు పెద్దలు, పురుషులు మరియు మహిళలకు అనుకూలంగా ఉంటుంది.\n\nమీరు అనారోగ్యంతో, గాయపడిన లేదా మీ వ్యక్తిగత శారీరక పరిస్థితి కారణంగా వ్యాయామం చేయలేకపోతే, దయచేసి వ్యాయామం చేసే ముందు మీ వైద్యుడిని సంప్రదించండి. వ్యాయామం చేసేటప్పుడు మీరు కొనసాగించే గాయాలకు బాధ్యత వహించరు.",
  'txtAboutAppAns2': "ఒక అనుభవశూన్యుడుగా, మీ లక్ష్యం మీ శరీరాన్ని మీ వ్యాయామానికి అనుగుణంగా మార్చడం మరియు వ్యాయామం రోజువారీ అలవాటుగా మార్చడం. వ్యాయామ తీవ్రత దశల వారీగా పెరుగుతుంది, మీరు ఎంచుకోవడం సులభం అని మీరు కనుగొంటారు.\n\n30 రోజుల ప్రణాళికతో పాటు, మీరు ప్రణాళిక పేజీలో ప్రారంభకులకు శిక్షణను కూడా ప్రయత్నించవచ్చు. యానిమేషన్ మరియు వీడియో మార్గదర్శకత్వంతో, ప్రతి వ్యాయామం సమయంలో మీరు సరైన ఫారమ్‌ను ఉపయోగిస్తున్నారని నిర్ధారించుకోవచ్చు.",
  'txtAboutAppAns3': "అవును. మీ వ్యాయామానికి ముందు సన్నాహక ముఖ్యం. ఇది గాయాలను తగ్గించడానికి మరియు మీ వ్యాయామ పనితీరును మెరుగుపరచడానికి మీకు సహాయపడుతుంది.\n\nవ్యాయామం తర్వాత శీతలీకరణ కూడా అవసరం, ఎందుకంటే ఇది మీ శరీరం దాని సాధారణ స్థితికి తిరిగి రావడానికి మరియు కండరాల నొప్పిని కూడా తగ్గించడానికి సహాయపడుతుంది.",
