  'txtAboutWorkoutAns3': "ఈ అనువర్తనం మీకు సురక్షితంగా బరువు తగ్గడానికి సహాయపడుతుంది. మీరు రాత్రిపూట బరువు తగ్గలేరు.\n\nబరువు తగ్గడం దీర్ఘకాలిక ప్రక్రియ కాబట్టి, మీరు దానికి అంటుకోవాలి",
  'txtAboutPaymentAns1': "1. మీ క్రొత్త పరికరంలోని అనువర్తనం గూగుల్ ప్లే నుండి డౌన్‌లోడ్ చేయబడిందని నిర్ధారించుకోండి.\n\n2. గూగుల్ ప్లేలో మీరు ఉపయోగిస్తున్న ఖాతా మీరు సభ్యత్వాన్ని పొందటానికి ఉపయోగించినట్లు నిర్ధారించుకోండి.\n\n3. అనువర్తనాన్ని పున art ప్రారంభించండి, ఇది మీ ప్రీమియం వెర్షన్‌కు ఆటో తిరిగి వస్తుంది.",
  'txtAboutPaymentAns2': "Google Play -V చందాలు -> మహిళల కోసం బరువు అనువర్తనాన్ని కోల్పోవడాన్ని కనుగొనండి -> చందా రద్దు చేయండి",
  'txtAboutPaymentAns3': "మీరు సభ్యత్వాన్ని రద్దు చేయకపోతే, ప్రస్తుత కాలం ముగిసేలో 24 గంటలలోపు మీ ఎసి-కౌంట్ పునరుద్ధరణకు వసూలు చేయబడుతుంది.\n\nదయచేసి మీ చందా స్థితిని తెలుసుకోవడానికి ప్లే స్టోర్ యొక్క చందా పేజీని తనిఖీ చేయండి.",
  'txtAboutPaymentAns4': "గూగుల్ ప్లే ద్వారా చేసిన అన్ని చెల్లింపులు గూగుల్ చేత నియంత్రించబడతాయి మరియు నిర్వహించబడతాయి.\n\nమీరు చందాను రద్దు చేయడం మర్చిపోతే లేదా పొరపాటున చందా పొందినట్లయితే, దయచేసి మరింత సమాచారం కోసం Google ప్లేను సంప్రదించండి.",
  'txtAboutPaymentAns5': "మీరు అనువర్తనాన్ని అన్‌ఇన్‌స్టాల్ చేయకపోతే, కానీ చందాను రద్దు చేయకపోతే, మీ ఖాతా ఇప్పటికీ Google Play ద్వారా వసూలు చేయబడుతుంది.",
