  ///  Exercise Description Strings
  'ex_desc_1': "మీ చేతులతో నేలపై నిలబడండి\nనేరుగా భుజం ఎత్తులో వైపుకు విస్తరించండి.\n\nమీ చేతులను సవ్యదిశలో పెద్ద సర్కిల్‌లలో వేగంగా తరలించండి.\n\nమీకు వీలైనంత వేగంగా చేయడానికి ప్రయత్నించండి.\n\nఇది డెల్టాయిడ్ కండరాలకు గొప్ప వ్యాయామం.",
  'ex_desc_2': "మీ పాదాలను మరియు మీ చేతులతో మీ వైపులా ప్రారంభించండి, ఆపై మీ పాదాలతో పైకి దూకుతారు మరియు మీ చేతులు ఓవర్ హెడ్.\n\nప్రారంభ స్థానానికి తిరిగి వెళ్ళు, ఆపై తదుపరి ప్రతినిధి చేయండి.\n\nఈ వ్యాయామం పూర్తి-శరీర వ్యాయామాన్ని అందిస్తుంది మరియు మీ అన్ని పెద్ద కండరాల సమూహాలను చేస్తుంది.",
  'ex_desc_3': "మీ పాదాలతో మరియు మీ వైపులా చేతులతో నిటారుగా నిలబడండి.\n\nఒక అడుగు ఒక అడుగు వైపుకు, మీ చేతులను పైకి లేపండి మరియు మీ చేతులను ఓవర్ హెడ్ తీసుకురండి.\n\nతిరిగి, వైపులా మారండి మరియు వ్యాయామం పునరావృతం చేయండి.",
  'ex_desc_4': "మీ అడుగుల భుజం వెడల్పుతో నిలబడి, మీ అర్మాన్ ముందుకు సాగండి, ఆపై మీ తొడలు అంతస్తుతో సమాంతరంగా ఉండే వరకు మీ శరీరాన్ని తగ్గించండి.\n\nమీ మోకాళ్ళను మీ కాలి మాదిరిగానే విస్తరించాలి.\n\nప్రారంభ స్థానానికి తిరిగి వచ్చి తదుపరి ప్రతినిధి చేయండి.\n\nఇది తొడలు, పండ్లు పిరుదులు, క్వాడ్లు, హామ్ స్ట్రింగ్స్ మరియు దిగువ శరీరాన్ని పనిచేస్తుంది.",
  'ex_desc_5': "మీ బట్ కింద మీ మోకాళ్ళతో మరియు మీ భుజాల క్రింద మీ చేతులతో అన్ని ఫోర్లలో ప్రారంభించండి.\n\nఅప్పుడు మీ కుడి కాలు ఎత్తండి మరియు మీ బట్ ను మీకు వీలైనంత వరకు పిండి వేయండి.\n\nప్రారంభ స్థానానికి తిరిగి వెళ్లి వ్యాయామం పునరావృతం చేయండి.",
  'ex_desc_6': "మీ బట్ కింద మీ మోకాళ్ళతో మరియు మీ భుజాల క్రింద మీ చేతులతో అన్ని ఫోర్లలో ప్రారంభించండి.\n\nఅప్పుడు మీ ఎడమ కాలును ఎత్తండి మరియు మీ బట్ ను మీకు వీలైనంత వరకు పిండి వేయండి.\n\nప్రారంభ స్థానానికి తిరిగి వెళ్లి వ్యాయామం పునరావృతం చేయండి.",
