  'ex_desc_29': "మీ వైపులా మీ చేతులతో మీ వెనుకభాగంలో పడుకోండి.\n\nమీ కాళ్ళను ఎత్తండి మరియు వాటిని మీకు వీలైనంత నిటారుగా ఉంచండి.\n\nఅప్పుడు త్వరగా మీ కుడి కాలును పైకి లేపండి మరియు ఏకకాలంలో మీ ఎడమ కాలును తగ్గించండి.\n\nకాళ్ళను మార్చండి మరియు పునరావృతం చేయండి.",
