  'ex_desc_32': "నేరుగా పైకి నిలబడండి.\n\nఅప్పుడు మీ కుడి కాలును వెనక్కి తీసుకొని మీ శరీరాన్ని తగ్గించండి.\n\nమీరు పైకి వచ్చినప్పుడు, మీ కుడి మోకాలిని మీకు వీలైనంత ఎత్తుగా పెంచండి.\n\nప్రారంభ స్థానానికి తిరిగి వెళ్లి, వ్యాయామాన్ని పునరావృతం చేయండి.",
