  'ex_desc_121': "కూర్చుని మీ కాళ్ళను చాప మీద దాటండి. మీ ఎడమ చేయి ఓవర్ హెడ్ ఎత్తండి మరియు మద్దతు కోసం మీ కుడి చేతిని నేలపై ఉంచండి.\n\nమీ ఎడమ చేతి వైపు చూడండి, మరియు నెమ్మదిగా మీ కుడి చేయిని వంగి ఉంటుంది; ఇంతలో, మీ ఎగువ శరీరాన్ని కుడి వైపున వంగండి. కొన్ని సెకన్ల పాటు పట్టుకోండి.",
  'ex_desc_122': "మీ తలపై మీ ఎడమ వైపున పడుకోండి మీ తల మీ ఎడమ చేయి మరియు మోకాలు వంగి ఉంటుంది.\n\nమీ మడమలను తాకినప్పుడు మీ కుడి మోకాలిని పైకి ఎత్తండి, ఆపై ప్రారంభ\nస్థానానికి తిరిగి వెళ్లండి. వ్యాయామం పునరావృతం చేయండి.",
  'ex_desc_123': "మీ తలపై మీ కుడి వైపున పడుకోండి మీ కుడి చేయి మరియు మోకాలు వంగి ఉంటాయి.\n\nమీ ఎడమ మోకాలిని పైకి ఎత్తండి, మీ మడమలను తాకినప్పుడు, ఆపై ప్రారంభ\nస్థానానికి తిరిగి వెళ్లండి. వ్యాయామం పునరావృతం చేయండి.",
  'ex_desc_124': "మీ తల మీ కుడి చేతిలో విశ్రాంతి తీసుకోవడంతో మీ కుడి వైపున పడుకోండి.\n\nఅప్పుడు మీ ఎడమ పాదాన్ని నేలపై ముందుకు ఉంచండి.\n\nమీ కుడి కాలును పైకి క్రిందికి ఎత్తండి.",
  'ex_desc_125': "మీ ఎడమ వైపు మీ తల విశ్రాంతి తీసుకోవడంతో మీ ఎడమ వైపు పడుకోండి.\n\nఅప్పుడు మీ కుడి పాదాన్ని నేలపై ముందుకు ఉంచండి.\n\nమీ ఎడమ కాలును పైకి క్రిందికి ఎత్తండి.",
  'ex_desc_128': "నేలపై కూర్చుని, ఆపై వెనుకకు వంగి, మీ కాళ్ళను నేల నుండి పైకి ఎత్తండి. బ్యాలెన్స్ స్థానాన్ని కనుగొన్న తరువాత, మీ ఎగువ శరీరాన్ని ఎత్తండి మరియు మీ మోకాళ్ళను మీ ఛాతీ వైపుకు తీసుకురండి. అప్పుడు సాగదీయండి మరియు పునరావృతం చేయండి.\n\nమీరు మీ శరీరాన్ని ఎత్తినప్పుడు మరియు మీరు విస్తరించినప్పుడు పీల్చేటప్పుడు hale పిరి పీల్చుకోండి.\n\nఇది తక్కువ ఉదర కండరాల కోసం గొప్ప వ్యాయామం.",
  'ex_desc_129': "నేలపై ఫ్లాట్ గా పడుకోండి మరియు మీ వెనుకభాగాన్ని నిటారుగా ఉంచేటప్పుడు మీ తుంటిని నేల నుండి ఎత్తండి.\n\nమీకు వీలైనంత కాలం ఈ స్థానాన్ని పట్టుకోండి.\n\nవంతెన వ్యాయామం మొత్తం ఉదరం, దిగువ వెనుక మరియు గ్లూట్లను బలపరుస్తుంది.",
  'ex_desc_130': "నేలపై మీ పాదాలతో ఫ్లాట్ తో మీ వెనుకభాగంలో పడుకోండి. మీ కుడి చీలమండ మీ ఎడమ మోకాలిపై, ఎడమ చేతిని మీ చెవి వెనుక మరియు కుడి చేయి నేలపై వైపుకు ఉంచండి.\n\nమీ భుజాలను నేల నుండి ఎత్తండి, మీ కుడి మోకాలిని కలవడానికి మీ ఎడమ మోచేయిని తీసుకురండి మరియు మీ శరీరానికి కుడి చేయి దగ్గరగా, ఆపై నెమ్మదిగా తిరిగి వస్తాయి. వ్యాయామం పునరావృతం చేయండి.",
  'ex_desc_131': "నేలపై మీ పాదాలతో ఫ్లాట్ తో మీ వెనుకభాగంలో పడుకోండి. మీ ఎడమ చీలమండను మీ కుడి మోకాలిపై, కుడి చేతిని మీ చెవి వెనుక మరియు ఎడమ చేయి నేలపై వైపుకు ఉంచండి.\n\nమీ భుజాలను నేల నుండి ఎత్తండి, మీ ఎడమ మోకాలిని కలవడానికి మీ కుడి మోచేయిని తీసుకురండి మరియు ఎడమ చేయి మీ శరీరానికి దగ్గరగా, ఆపై నెమ్మదిగా తిరిగి వెళ్ళు. వ్యాయామం పునరావృతం చేయండి.",
  'ex_desc_132': "మీ కాళ్ళు విస్తరించి, మీ చేతుల్లో మీ గడ్డం మీ కడుపుపై పడుకోండి.\n\nమీ కాళ్ళను నేల నుండి ఎత్తండి, ఆపై ప్రత్యామ్నాయంగా మీ ఎడమ మరియు కుడి కాళ్ళను ఎత్తండి.",
  'ex_desc_133': "నేలపై కూర్చోండి, మీ కాళ్ళను 45 డిగ్రీల కోణంలో పైకి ఎత్తండి మరియు మీ పై శరీరాన్ని 45 డిగ్రీల కోణంలో వెనక్కి తీసుకోండి.\n\nమీ చేతులను ముందుకు సాగండి.\n\nఈ స్థానాన్ని కలిగి ఉండండి.",
  'ex_desc_134': "మీ మోకాళ్ళు వంగి,\nమడమలు కలిసి పిండి వేయండి.\n\nఅప్పుడు మీ పాదాలను పైకి క్రిందికి ఎత్తండి. మీ బట్ స్క్వీజ్ చేయడంలో వ్యాయామం చాలా ప్రభావవంతంగా ఉంటుంది.",
  'ex_desc_135': "మీ మోకాళ్ళు వంగి, అడుగులు నేలమీద చదునుగా మరియు మీ తుంటి కింద చేతులతో మీ వెనుకభాగంలో పడుకోండి.\n\nమీ కాళ్ళను టేబుల్‌టాప్ స్థానానికి పెంచండి; మీ ఎడమ పాదాన్ని భూమి వైపు వదలండి. మీ కాలితో భూమిని నొక్కండి; అప్పుడు కాలు తిరిగి పెంచండి. వైపులా మార్చండి మరియు వ్యాయామం పునరావృతం చేయండి.",
  'ex_desc_136': "మీ చేతులు పూర్తిగా విస్తరించడంతో మరియు మీ బ్రొటనవేళ్లు పైకి లేవడంతో నేలపై ముఖం పడుకోండి, మీ శరీరం \"y\" అక్షరం ఆకారంలో ఉండాలి.\n\nమీ చేతులను మీకు వీలైనంతవరకు భూమి నుండి పైకి లేపండి మరియు వాటిని 2 సెకన్ల పాటు పైభాగంలో పాజ్ చేయండి. నెమ్మదిగా ప్రారంభ స్థానానికి తిరిగి వెళ్లి, వ్యాయామాన్ని పునరావృతం చేయండి.\n",
  'ex_desc_137': "మీ పాదాలతో కలిసి నేలపై కూర్చోండి మరియు మీ కాలిని పట్టుకోండి.\n\nమీ మోకాళ్ళను వైపులా తెరిచి, మీ మోకాళ్ళను క్రిందికి నొక్కండి. ఈ స్థానాన్ని పట్టుకోండి.",
  'ex_desc_138': "మీ కాళ్ళు విస్తరించడంతో మీ వెనుకభాగంలో పడుకోండి.\n\nమీ మోకాళ్ళను వంచి, వాటిని మీ ఛాతీ వైపుకు తీసుకురండి; మీ మోకాళ్ళను రెండు చేతులతో కౌగిలించుకోండి. కొన్ని సెకన్ల పాటు పట్టుకోండి.",
  'ex_desc_139': "90\nడిగ్రీ కోణంలో మీ మోకాళ్ళతో మీ వెనుకభాగంలో పడుకోండి.\n\nమీ చేతులను వైపులా విస్తరించి, మీ అరచేతులను నేలమీద ఉంచండి.\n\nమీ కాళ్ళను ఎడమ వైపుకు వక్రీకరించండి, మీ ఎగువ శరీరాన్ని మరియు మీ మోకాలు మరియు పాదాలను కలిసి ఉంచేటప్పుడు.\n\nఒక సెకనుకు పట్టుకోండి, ఆపై తిరిగి వచ్చి మరొక వైపుకు వక్రీకరించండి. వ్యాయామం పునరావృతం చేయండి.",
  'ex_desc_140': "ప్రామాణిక ప్లాంక్ స్థానంలో ప్రారంభించండి.\n\nమీ వెన్నెముకను మీ ఎడమ వైపుకు తిప్పండి, మీ ఎడమ కాలు నేలని తాకే వరకు, ఆపై\nమరొక వైపుకు ట్విస్ట్ చేయండి.\n\nవ్యాయామం పునరావృతం చేయండి.",
  'ex_desc_141': "మీ చేతులు మరియు కాళ్ళ వద్ద మీ చేతులతో విస్తరించి మీ వెనుకభాగంలో పడుకోండి.\n\nమీ కాళ్ళు మరియు చేతులను నేల నుండి ఎత్తండి. అప్పుడు మీ పైభాగాన్ని పైకి లేపండి మరియు మీ చేతులు మరియు మోకాళ్ళను మీ ఉదర వైపు పిండి వేయండి.\n\nమీ చేతులు మరియు కాళ్ళను తగ్గించండి (కానీ నేల తాకవద్దు) మరియు వ్యాయామాన్ని పునరావృతం చేయండి.",
