  'ex_desc_165': "కుర్చీ ముందు నిలబడండి. అప్పుడు\nకుర్చీపైకి అడుగుపెట్టి వెనుకకు అడుగు పెట్టండి.\n\nకాళ్ళు మరియు\nపిరుదులను బలోపేతం చేయడానికి వ్యాయామం పనిచేస్తుంది.",
