  'ex_desc_167': "ఒక తలుపును కనుగొనండి, డోర్ఫ్రేమ్\nమరియు మీ మోచేతులు మీ భుజాల కంటే కొంచెం తక్కువగా ఉన్న మీ చేతులతో\nతలుపులో ఒక లంజ స్థానం తీసుకోండి, ఆపై నెమ్మదిగా మీ ఛాతీని ముందుకు తీసుకురండి.\n\nఈ స్థానాన్ని 30-40 సెకన్ల పాటు పట్టుకోండి. అప్పుడు\nనెమ్మదిగా దాని నుండి బయటకు వచ్చి, మీ చేతులను క్రిందికి తీసుకురండి మరియు కొన్ని భుజం రోల్స్ చేయండి.\n\nమీ తలను ముందుకు లాగకండి మరియు మీ మెడను సడలించండి.",
  'ex_desc_168': "మీ కాళ్ళు విస్తరించడంతో మీ వెనుకభాగంలో పడుకోండి.\nమీ కుడి కాలును పైకి ఎత్తండి మరియు మీ కుడి మోకాలిని ఎడమ వైపుకు లాగడానికి మీ ఎడమ చేతిని వాడండి, కానీ మీ ఇతర చేతిని\nఅంతస్తులో వైపుకు విస్తరించండి.\n\nఈ స్థానాన్ని కొన్ని సెకన్ల పాటు పట్టుకోండి.",
  'ex_desc_169': "మీ కాళ్ళు విస్తరించడంతో మీ వెనుకభాగంలో పడుకోండి.\n\nమీ ఎడమ కాలును పైకి ఎత్తండి మరియు మీ ఎడమ మోకాలిని కుడి వైపుకు లాగడానికి మీ కుడి చేతిని వాడండి, కానీ మీ ఇతర చేతిని\nఅంతస్తులో వైపుకు విస్తరించండి.\n\nఈ స్థానాన్ని కొన్ని సెకన్ల పాటు పట్టుకోండి.",
  'ex_desc_170': "పుష్-అప్ స్థానంలో ప్రారంభించండి.\n\nమీ ఎడమ మోకాలిని ముందుకు తీసుకురండి మరియు మీ కుడి మోకాలిని నేలపై పడండి.\n\nమీ పైభాగాన్ని పెంచండి మరియు మీ చేతులను మీ నడుముపై ఉంచండి.\n\nఅప్పుడు మీ పై శరీరాన్ని నిటారుగా ఉంచేటప్పుడు మీ తుంటిని ముందుకు నెట్టండి.\n\nదయచేసి మీ ముందు మోకాలి మీ కాలి మీదకు వెళ్ళకుండా చూసుకోండి.\n\nఈ స్థానాన్ని కొన్ని సెకన్ల పాటు పట్టుకోండి.",
  'ex_desc_171': "పుష్-అప్ స్థానంలో ప్రారంభించండి.\n\nమీ కుడి మోకాలిని ముందుకు తీసుకురండి మరియు మీ ఎడమ మోకాలిని నేలపై పడండి.\n\nమీ పైభాగాన్ని పెంచండి మరియు మీ చేతులను మీ నడుముపై ఉంచండి.\n\nఅప్పుడు మీ పై శరీరాన్ని నిటారుగా ఉంచేటప్పుడు మీ తుంటిని ముందుకు నెట్టండి.\n\nదయచేసి మీ ముందు మోకాలి మీ కాలి మీదకు వెళ్ళకుండా చూసుకోండి.\n\nఈ స్థానాన్ని కొన్ని సెకన్ల పాటు పట్టుకోండి.",
  'ex_desc_172': "మీ చేతులతో నేలపై నిలబడండి మీ తుంటిపై మరియు మీ అడుగుల భుజం వెడల్పు\nవేరుగా ఉంటుంది.\n\nమీ ఎడమ కాలును నడుము స్థాయిలో పైకి ఎత్తండి మరియు మీ మోకాలిని లంబ కోణంలో వంగి ఉంటుంది.\n\nఅప్పుడు మీ శరీరాన్ని ఎడమ వైపుకు తిప్పండి మరియు\nవెనుకకు తిప్పండి. వైపులా మార్చండి మరియు వ్యాయామాన్ని పునరావృతం చేయండి.\n\nమీ నిలబడి ఉన్న కాలు యొక్క కాలిని ముందుకు ఉంచండి. మీ మోకాలు మీ కాలి మాదిరిగానే ఉండాలి.",
  'ex_desc_173': "నేలపై నిలబడి, మీ కాళ్ళను కొద్దిగా వంచి,\nమీ పై శరీరాన్ని ముందుకు తిప్పండి.\n\nఅప్పుడు కుడి వైపుకు దూకుతారు. మీరు దూకినప్పుడు, మీ వెనుక మీ ఎడమ పాదాన్ని మరియు మీ ఎడమ చేతిని మీరు ముందు తీసుకురండి.\n\nఅప్పుడు మరొక వైపుకు దూకుతారు. వ్యాయామం పునరావృతం చేయండి.",
  'ex_desc_174': "మీ పాదాలతో భుజం-వెడల్పుతో నిలబడండి మరియు\nమీ ఆధిపత్య పాదాన్ని కొద్దిగా ముందుకు ఉంచండి.\nమీ మోకాళ్ళను కొద్దిగా వంచి, మీ పిడికిలిని పట్టుకోండి మరియు మీ మోచేతులను 90 డిగ్రీల వద్ద వంచు.\n\nమీ కుడి చేతిని భుజం ఎత్తుకు పెంచండి మరియు మీ ముంజేయిని భూమికి సమాంతరంగా ఉంచండి. మీ భుజాలు మరియు పండ్లు మరియు ఎడమ వైపున గుద్దండి.\nవైపులా మారండి మరియు పునరావృతం చేయండి.",
  'ex_desc_175': "మీ శరీరానికి మద్దతుగా ఆయుధాలతో నేలమీద వేసుకోండి.\n\nపెంచేటప్పుడు మీ శరీరాన్ని నిటారుగా ఉంచండి మరియు మీ శరీరాన్ని మీ చేతులతో తగ్గించండి.\n\nఈ వ్యాయామం ఛాతీ, భుజాలు, ట్రైసెప్స్,\nవెనుక మరియు కాళ్ళు పనిచేస్తుంది.",
  'ex_desc_176': "పుష్-అప్ స్థానంలో ప్రారంభించండి. అప్పుడు\nపుష్-అప్ కోసం దిగండి మరియు మీరు పైకి వచ్చేటప్పుడు, మీ ఎగువ శరీరాన్ని తిప్పండి మరియు మీ కుడి చేతిని పైకి విస్తరించండి.\n\nమరొక చేత్తో వ్యాయామాన్ని పునరావృతం చేయండి. ఇది ఛాతీ, భుజాలు, చేతులు మరియు\nకోర్ కోసం గొప్ప వ్యాయామం.",
  'ex_desc_177': "మీ ముంజేయి మీ శరీరానికి మద్దతు ఇవ్వడంతో మీ కుడి వైపున పడుకోండి. మీ శరీరాన్ని సరళ రేఖలో పట్టుకోండి.\n\nఈ వ్యాయామం ఉదర కండరాలు మరియు\nవాలులను లక్ష్యంగా చేసుకుంటుంది.",
  'ex_desc_178': "మీ ముంజేయి మద్దతుతో మీ ఎడమ వైపున పడుకోండి. మీ శరీరాన్ని సరళ రేఖలో పట్టుకోండి.\n\nఈ వ్యాయామం ఉదర కండరాలు మరియు\nవాలులను లక్ష్యంగా చేసుకుంటుంది.",
  'ex_desc_179': "మీ వెనుక భాగంలో మోకాళ్ళు వంగి, అడుగులు ఫ్లాట్\nనేల మీద ఫ్లాట్ చేయండి. మీ చేతులను నేరుగా మీ తల పైన ఉంచండి.\n\nమీ పై శరీరాన్ని నేల నుండి ఎత్తండి, ఆపై నెమ్మదిగా\nప్రారంభ స్థానానికి తిరిగి వెళ్ళండి. వ్యాయామం am n ఉదర ఓర్పును పెంచుతుంది.",
  'ex_desc_180': "మీ అడుగుల భుజం వెడల్పుతో నిలబడి, మీ మోకాలు కొద్దిగా వంగి ఉంటాయి.\n\nమీ మోచేతులతో మీ చేతులను మీ ముందు ఎత్తండి.\n\nమీ ఎగువ శరీరాన్ని ఎడమ వైపుకు తిప్పండి, ఆపై\nకుడి.",
  'ex_desc_181': "మీ కాళ్ళతో నేరుగా మీ వెనుకభాగంలో పడుకోండి మరియు మీ చేతులను మీ వైపులా చేయండి.\n\nమీ కుడి కాలును పైకప్పు వైపు ఎత్తండి. మీ చేతులతో మీ తొడ వెనుక భాగాన్ని పట్టుకోండి.\nఈ స్థానాన్ని ఉంచండి.",
  'ex_desc_182': "మీ కాళ్ళతో నేరుగా మీ వెనుకభాగంలో పడుకోండి మరియు మీ చేతులను మీ వైపులా చేయండి.\n\nమీ ఎడమ కాలును పైకప్పు వైపు ఎత్తండి. మీ చేతులతో మీ తొడ వెనుక భాగాన్ని పట్టుకోండి.\nఈ స్థానాన్ని ఉంచండి.",
  'ex_desc_183': "భుజం ఎత్తులో మీ చేతులు మీ వైపులా విస్తరించడంతో నేలపై నిలబడండి.\n\nఅప్పుడు మీ శరీరాన్ని వంచి, మీ కుడి పాదాన్ని తాకడానికి మీ ఎడమ చేతిని ఉపయోగించండి లేదా మీకు వీలైనంత దగ్గరగా పొందండి. భుజాలను మార్చండి మరియు పునరావృతం చేయండి.\n\nమీరు మీ శరీరాన్ని వంగి ఉన్నప్పుడు hale పిరి పీల్చుకోండి మరియు మీరు పైకి వచ్చినప్పుడు పీల్చండి.\nవ్యాయామం సమయంలో\n\nమీ వెనుక మరియు కాళ్ళను నిటారుగా ఉంచండి.",
