  'ex_desc_207': "నేలమీద ముంజేయి మరియు అరచేతులను తగ్గించడంతో నేలమీద వేసుకోండి.\n\nమీ తొడల క్రింద ఒక నురుగు రోలర్‌ను ఉంచండి మరియు మీ\nఅడుగుల భూమి నుండి ఎత్తండి. క్వాడ్రిసెప్స్‌ను మీ హిప్ నుండి మీ మోకాళ్ల వరకు ముందుకు వెనుకకు వెళ్లండి.",
  'ex_desc_208': "మీ కాళ్ళ ముందు మీ ముందు విస్తరించిన నేలపై కూర్చోండి. మీ తొడల క్రింద ఒక నురుగు రోలర్ ఉంచండి, మద్దతు కోసం మీ చేతులను మీ వెనుక నేలపై ఉంచండి.\n\nమీ పాదాలను భూమి నుండి ఎత్తండి మరియు మీ తుంటి నుండి మీ హామ్ స్ట్రింగ్స్ మీ మోకాళ్ళకు వెనుకకు\nవెనుకకు వెళ్లండి.",
  'ex_desc_209': "మీ కాళ్ళ ముందు మీ ముందు విస్తరించిన నేలపై కూర్చోండి. మీ మోకాళ్ల క్రింద ఒక నురుగు రోలర్ ఉంచండి,\nమరియు మీ చేతులను మీ వెనుక నేలపై ఉంచండి.\n\nనెమ్మదిగా మీ కుడి పాదాన్ని ఎత్తండి మరియు మీ కాలును మీకు వీలైనంత ఎక్కువ నిఠారుగా చేయండి. అప్పుడు నెమ్మదిగా దానిని తగ్గించండి. వ్యాయామం పునరావృతం చేయండి.",
  'ex_desc_210': "మీ కాళ్ళ ముందు మీ ముందు విస్తరించిన నేలపై కూర్చోండి. మీ మోకాళ్ల క్రింద ఒక నురుగు రోలర్ ఉంచండి,\nమరియు మీ చేతులను మీ వెనుక నేలపై ఉంచండి.\n\nనెమ్మదిగా మీ ఎడమ పాదాన్ని ఎత్తండి మరియు మీ కాలును మీకు వీలైనంత ఎక్కువ నిఠారుగా చేయండి. అప్పుడు నెమ్మదిగా దానిని తగ్గించండి. వ్యాయామం పునరావృతం చేయండి.",
  'ex_desc_211': "మీ మోకాలు వంగి, అడుగులు నేలమీద చదునుగా మీ వెనుకభాగంలో పడుకోండి.\n\nమీ వెనుక వెనుక భాగాన్ని భూమిపై చదును చేయండి\nమీ దిగువ వీపు మరియు నేల మధ్య అంతరాన్ని తొలగించడానికి, ఆపై ప్రారంభ స్థానానికి తిరిగి వెళ్ళు.\n\nవ్యాయామం పునరావృతం చేయండి.",
  'ex_desc_212': "నెమ్మదిగా నడవండి. మీ మడమను నేలమీద ఉంచండి, పూర్తిగా పాదం ద్వారా మీ కాలి వరకు రోల్ చేయండి, ఆపై మీ కాలితో మీరే ముందుకు నెట్టండి.",
  'ex_desc_213': "గోడకు వ్యతిరేకంగా చేతులతో నిలబడండి. మీ ఎడమ చీలమండపై మీ కుడి\nఅడుగు ఉంచండి, ఆపై మీ ఎడమ మడమను పైకి క్రిందికి ఎత్తండి.",
  'ex_desc_214': "గోడకు వ్యతిరేకంగా చేతులతో నిలబడండి. మీ ఎడమ పాదాన్ని మీ కుడి చీలమండపై ఉంచండి, ఆపై మీ కుడి మడమను పైకి ఎత్తండి మరియు\nక్రిందికి.",
  'ex_desc_215': "పుష్-అప్ స్థానంలో ప్రారంభించండి, కానీ మీ చేతులను నిటారుగా ఉంచండి. ఈ వ్యాయామం మీ ఉదరం మరియు వెనుక కండరాలను బలపరుస్తుంది.",
  'ex_desc_216': "మీ ఎడమ వైపు పడుకోండి. మీ ఎడమ మోచేయిని నేరుగా మీ భుజాల క్రింద ఉంచండి మరియు మీ నడుముపై మీ కుడి చేతిని ఉంచండి. మీ కుడి కాలు మీ ఎడమ కాలు మీద ఉంచండి.\n\nమీ తుంటిని పైకి లేపండి, 2-4\nసెకన్ల పాటు పట్టుకోండి, ఆపై ప్రారంభ స్థానానికి తిరిగి వెళ్లండి.\n\nఈ వ్యాయామం పునరావృతం చేయండి.",
  'ex_desc_217': "మీ కుడి వైపున పడుకోండి. మీ కుడి మోచేయిని నేరుగా మీ భుజాల క్రింద ఉంచండి మరియు మీ నడుముపై మీ ఎడమ చేతిని ఉంచండి. మీ ఎడమ కాలు మీ కుడి కాలు మీద ఉంచండి.\n\nమీ తుంటిని పైకి లేపండి, 2-4\nసెకన్ల పాటు పట్టుకోండి, ఆపై ప్రారంభ స్థానానికి తిరిగి వెళ్లండి.\n\nఈ వ్యాయామం పునరావృతం చేయండి.",
  'ex_desc_218': "సాంప్రదాయ ప్లాంక్ స్థితిలో ప్రారంభించండి, ఆపై ప్రత్యామ్నాయంగా ఒక చేతిని ముందుకు విస్తరించండి. వ్యాయామం చేసేటప్పుడు\n\nమీ శరీరాన్ని నిటారుగా ఉంచండి.\n\nఇది ఉదర\nకండరాల మరియు డెల్టాయిడ్ కండరాలకు గొప్ప వ్యాయామం.",
  'ex_desc_219': "కుడి వైపు ప్లాంక్ స్థానంలో ప్రారంభించండి, ఆపై మీ ఎగువ కాలును ఎత్తండి మరియు దానిని ముందుకు తండించండి. ప్రారంభ స్థానానికి తిరిగి వచ్చి పునరావృతం చేయండి.\n\nమీ తుంటిని తిప్పండి మరియు వ్యాయామం చేసేటప్పుడు మీ కాళ్ళను మరియు ఎగువ శరీరాన్ని నిటారుగా ఉంచండి.\n\nమీ కాలు తన్నాడు మరియు మీ కాలు తిరిగి వచ్చినప్పుడు పీల్చండి.\n\nఇది గ్లూటియస్ మరియు\nక్వాడ్రిసెప్స్ కోసం గొప్ప వ్యాయామం.",
  'ex_desc_220': "ఎడమ వైపు ప్లాంక్ స్థానంలో ప్రారంభించండి, ఆపై మీ ఎగువ కాలును ఎత్తి ముందుకు కిక్ చేయండి. ప్రారంభ స్థానానికి తిరిగి వచ్చి పునరావృతం చేయండి.\n\nమీ తుంటిని తిప్పండి మరియు వ్యాయామం చేసేటప్పుడు మీ కాళ్ళను మరియు ఎగువ శరీరాన్ని నిటారుగా ఉంచండి.\n\nమీ కాలు తన్నాడు మరియు మీ కాలు తిరిగి వచ్చినప్పుడు పీల్చండి.\n\nఇది గ్లూటియస్ మరియు\nక్వాడ్రిసెప్స్ కోసం గొప్ప వ్యాయామం.",
  'ex_desc_221': "మీ కాళ్ళు వంగి, పండ్లు పైకి మరియు వేళ్లు మీ భుజాల క్రింద ముందుకు చూపిస్తూ నేలపై కూర్చోండి.\n\nమీ పాదాలను గాలి ప్రత్యామ్నాయ ఎడమ మరియు కుడి వైపున తన్నండి.",
  'ex_desc_222': "మీ చెవుల వెనుక మీ చేతులతో మీ వెనుకభాగంలో పడుకోండి.\n\nఅప్పుడు మీ పై శరీరాన్ని నేల నుండి ఎత్తండి మరియు నెమ్మదిగా కూర్చున్న స్థానం వరకు. మీరు లేచినప్పుడు మీ మెడను టగ్ చేయవద్దు.\n\nనెమ్మదిగా ప్రారంభ స్థానానికి తిరిగి వెళ్లి వ్యాయామం పునరావృతం చేయండి.\n\nమీ వెన్నెముక బాధించినట్లయితే, దయచేసి మరొక వ్యాయామానికి మార్చండి.",
  'ex_desc_223': "మీ చేతులతో మీ వైపులా మరియు కాళ్ళ వద్ద మీ వెనుకభాగంలో పైకప్పు వైపు పడుకోండి.\n\nమీ తుంటిని నేరుగా నేల నుండి పైకి లేపండి, ఆపై తిరిగి ప్రారంభ స్థానానికి వెళ్ళండి.\n\nవ్యాయామం పునరావృతం చేయండి.",
  'ex_desc_224': "మీ అడుగుల భుజం వెడల్పుతో నిలబడండి.\n\nమీ చేతులను నేలమీద ఉంచి, మీ పాదాలను వెనుకకు తన్నండి. మీ కుడి మోకాలిని మీ ఛాతీ వైపు వంచి, మీ ఎడమ కాలును నిటారుగా ఉంచండి, ఆపై త్వరగా మీ ఎడమ కాలుకు మారండి.\n\nమీ ఎడమ పాదాన్ని వెనుకకు కిక్ చేసి, ఆపై పైకి దూకుతారు. వ్యాయామం పునరావృతం చేయండి.",
  'ex_desc_225': "మీ మోకాలు వంగి, కాళ్ళతో కొంచెం వేరుగా ఉన్న అబద్ధ స్థితిలో ప్రారంభించండి.\n\nమీ చెవుల వెనుక మీ చేతులను ఉంచండి. మీ ఎగువ శరీరాన్ని పైకి లేపండి మరియు ఒక వైపుకు మలుపు తిప్పండి.\n\nనెమ్మదిగా దానిని ప్రారంభ స్థానానికి తగ్గించండి. మరొక వైపు పునరావృతం చేయండి.",
  'ex_desc_226': "మీ కాళ్ళతో నేరుగా పైకప్పు మరియు మీ చేతులతో మీ వైపులా మీ వెనుకభాగంలో పడుకోండి.\n\nమీ కాళ్ళలో ఒకదాన్ని తగ్గించండి. మీరు దాన్ని పైకి లేపినప్పుడు, మీ తుంటిని నేల నుండి పైకి ఎత్తండి.\n\nప్రారంభ స్థానానికి తిరిగి వెళ్ళు. ఇతర కాలుకు మారండి మరియు వ్యాయామం పునరావృతం చేయండి.",
  'ex_desc_227': "మీ అరచేతులతో మీ తుంటి వెనుక మీ వైపులా నేలమీద కూర్చోండి.\n\nమీ కాళ్ళను విస్తరించి భూమి నుండి పైకి లేపండి. మీ కాళ్ళను అపసవ్య దిశలో సర్కిల్‌లలో తరలించండి.",
  'ex_desc_228': "భుజం ఎత్తులో మీ చేతులు నేరుగా వైపులా విస్తరించడంతో నేలపై నిలబడండి.\n\nమీ చేతులను సవ్యదిశలో సర్కిల్‌లలో వేగంగా తరలించండి.\n\nమీకు వీలైనంత వేగంగా చేయడానికి ప్రయత్నించండి.\n\nడెల్టాయిడ్ కండరాల కోసం ఇది గొప్ప వ్యాయామం.",
  'ex_desc_229': "మీ ముంజేయి మీ శరీరానికి మద్దతు ఇస్తూ మీ ఎడమ వైపున పడుకోండి మరియు మోకాళ్ళు నేలపై వంగి ఉంటాయి.\n\nమీ వెన్నెముకను నిటారుగా ఉంచండి. ఈ స్థానాన్ని పట్టుకోండి.",
  'ex_desc_230': "మీ ముంజేయి మీ శరీరానికి మద్దతు ఇస్తూ మీ కుడి వైపున పడుకోండి మరియు మోకాళ్ళు నేలపై వంగి ఉంటాయి.\n\nమీ వెన్నెముకను నిటారుగా ఉంచండి. ఈ స్థానాన్ని పట్టుకోండి.",
  'ex_desc_231': "మీ చేతులతో నేలపై నిలబడండి\nనేరుగా భుజం ఎత్తులో వైపుకు విస్తరించండి.\n\nమీ చేతులను అపసవ్య దిశలో పెద్ద సర్కిల్‌లలో కదిలించండి\nవేగంగా.\n\nమీకు వీలైనంత వేగంగా చేయడానికి ప్రయత్నించండి.\n\nఇది డెల్టాయిడ్ కండరాలకు గొప్ప వ్యాయామం.",
  'ex_desc_232': "ముందుకు సాగండి, మీ మోకాలు మరియు మీ మోచేతులను వంచు.\n\nమీ వెనుక మీ చేతులను విస్తరించి, మీ ris n ట్రైసెప్స్‌ను పిండి వేయండి. దయచేసి మీ చేతులను విస్తరించేటప్పుడు\nభూమికి సమాంతరంగా చేయండి.\n\nప్రారంభ స్థానానికి తిరిగి వెళ్లి, ఈ వ్యాయామాన్ని పునరావృతం చేయండి.",
  'ex_desc_233': "మీ కాళ్ళు వంగి, మీ చేతులు భుజం-వెడల్పును మీ వెనుక ఉన్న నేలమీద ఉంచండి,\n, మీ వేళ్లు పక్కకి ఎదురుగా ఉన్నాయని నిర్ధారించుకోండి.\n\nమీ పైభాగం భూమికి సమాంతరంగా ఉండే వరకు మీ తుంటిని ఎత్తండి మరియు మీ చేతులు మరియు\nఅడుగులతో ముందుకు నడవండి.",
  'ex_desc_234': "మీ పాదాలతో నిటారుగా నిలబడండి.\n\nమీ చేతులను మీ ముందు భుజం ఎత్తులో ఒక చేయితో పాటు మరొక చేతులతో మరొకటి \"x\" అక్షరం ఆకారంలో అతివ్యాప్తి చేసి, ఆపై వాటిని వేరుగా విస్తరించండి.\n\nచేతులను మార్చండి మరియు వ్యాయామం పునరావృతం చేయండి.",
  'ex_desc_235': "స్ట్రెయిట్ ఆర్మ్ ప్లాంక్ స్థానంలో ప్రారంభించండి. Left n మీ ఎడమ భుజం నొక్కడానికి మీ కుడి చేతిని ఎత్తండి.\n\nప్రారంభ స్థానానికి తిరిగి వచ్చి మరో చేతితో పునరావృతం చేయండి.",
  'ex_desc_236': "మీ కుడి చేత్తో గోడకు దగ్గరగా నిలబడండి.\nమీ కుడి చేయిని విస్తరించి, మీ కుడి చేతిని గోడపై ఉంచండి, ఆపై మీ శరీరాన్ని సున్నితంగా ఎడమ వైపుకు తిప్పండి.",
  'ex_desc_237': "మీ ఎడమ చేత్తో గోడకు దగ్గరగా నిలబడండి.\nమీ ఎడమ చేతిని విస్తరించి, మీ ఎడమ చేతిని గోడపై ఉంచండి, ఆపై మీ శరీరాన్ని సున్నితంగా కుడి వైపుకు తిప్పండి.",
  'ex_desc_238': "మీ అడుగుల భుజం వెడల్పుతో నేలపై నిలబడండి. మీ అరచేతులను ఒకదానికొకటి ఎదుర్కొంటున్న భుజం ఎత్తులో మీ చేతులను ముందుకు విస్తరించండి.\n\nవీలైనంతవరకు మీ చేతులను విస్తరించండి, ఆపై వాటిని తిరిగి ముందు వైపుకు తరలించండి. వ్యాయామం పునరావృతం చేయండి.",
  'ex_desc_239': "మీ చేతులను కలిసి పట్టుకోండి మరియు వాటిని ఓవర్ హెడ్ ఎత్తండి. అప్పుడు మీ చేతులను పెద్ద సర్కిల్‌లలో అపసవ్య దిశలో కదిలించండి.",
  'ex_desc_240': "మీ చేతులను కలిసి పట్టుకోండి మరియు వాటిని ఓవర్ హెడ్ ఎత్తండి. అప్పుడు మీ చేతులను సవ్యదిశలో పెద్ద సర్కిల్‌లలో కదిలించండి.",
  'ex_desc_241': "గోడకు వ్యతిరేకంగా మీ చేతులతో గోడ ముందు నిలబడండి. నెమ్మదిగా వెనుకకు అడుగు పెట్టండి మరియు మీ పై శరీరం నేలకి సమాంతరంగా ఉండే వరకు మీ చేతులను క్రిందికి జారండి.\n\nమీరు మీ తుంటిని గోడ నుండి దూరంగా లాగడంతో మీ చేతులను గోడలోకి ముందుకు నెట్టండి. బరువు మీ బరువును మీ పాదాలకు బదిలీ చేయండి. ఈ స్థానాన్ని పట్టుకోండి.",
  'ex_desc_242': "మీ మోకాలు వంగి, మీ అడుగులు నేలపై ఫ్లాట్ గా కూర్చోండి.\n\nమీ చేతులను మీ వెనుక నేలపై ఉంచండి మరియు\nమీ వేళ్లను వెనుకకు ఉంచండి.\n\nమీ భుజాల ముందు భాగంలో సాగదీయడానికి మీ మోచేతులను కొద్దిగా వంచి.",
  'ex_desc_243': "మీ కాళ్ళు విస్తరించి, మీ వైపులా చేతులతో అబద్ధం చెప్పే స్థితిలో ప్రారంభించండి.\n\nఏకకాలంలో మీ ఎడమ కాలు మరియు మీ ఎగువ శరీరాన్ని భూమి నుండి పైకి ఎత్తండి మరియు మీ కాలిని తాకడానికి మీ కుడి చేతిని ఉపయోగించండి. ఇతర కాలుతో పునరావృతం చేయండి.",
  'ex_desc_244': "మీ అరచేతులతో మీ తుంటి వెనుక మీ వైపులా నేలమీద కూర్చోండి.\n\nమీ కాళ్ళను విస్తరించి భూమి నుండి పైకి లేపండి. మీ కాళ్ళను సవ్యదిశలో సర్కిల్‌లలో కదిలించండి.",
  'ex_desc_245': "మీ శరీరానికి మద్దతుగా మీ కాళ్ళు కలిసి వంగి మీ భుజాల క్రింద మీ చేతులతో నేలపై కూర్చోండి. మీ తుంటిని నేల నుండి ఎత్తేటప్పుడు ఒక కాలును పైకి ఎత్తండి. ఇతర కాలుకు మారి పునరావృతం చేయండి. మీ వెనుకకు బదులుగా మీ తుంటితో మిమ్మల్ని మీరు ముందుకు నెట్టండి. ఇది గ్లూటియస్‌కు గొప్ప వ్యాయామం.",
