  'ex_desc_247': "కూర్చుని మీ కాళ్ళను చాప మీద దాటండి. మీ ఎడమ చేతిని మీ కుడి మోకాలిపై మరియు మీ కుడి చేతిని మీ వెనుక నేలపై ఉంచండి.",
  'ex_desc_248': "కూర్చుని మీ కాళ్ళను చాప మీద దాటండి. మీ కుడి చేతిని మీ ఎడమ మోకాలిపై మరియు మీ ఎడమ చేతిని మీ వెనుక నేలపై ఉంచండి. నెమ్మదిగా మీ పై శరీరాన్ని ఎడమ వైపుకు తిప్పండి. కొన్ని సెకన్ల పాటు పట్టుకోండి.",

