  ///  Plan Introduction Strings
  'plan_introduction_1': "3-10 నిమిషాల సమర్థవంతమైన వ్యాయామం మీరు కొవ్వును కోల్పోవటానికి మరియు ఆరోగ్యంగా ఉండటానికి సహాయపడుతుంది. మీ బరువు తగ్గించే లక్ష్యాన్ని వేగంగా సాధించండి!",
  'plan_introduction_2': "మీ బట్ను బిగించి ఎత్తడానికి 5-15 నిమిషాలు సాధారణ వ్యాయామాలు. ఏ సమయంలోనైనా బాగా ఆకారపు బట్ పొందండి!",
  'plan_introduction_3': "బొడ్డు కొవ్వును కోల్పోండి మరియు ఇంట్లో మా చిన్న మరియు సమర్థవంతమైన వ్యాయామాలతో మీ కడుపుని చదును చేయండి! మీరు కొన్ని వారాల్లో ఫ్లాట్ కడుపు పొందుతారు!",
  'plan_introduction_4': "ఈ వ్యాయామాలు కండరాలను నిర్మించడానికి మరియు బలాన్ని మెరుగుపరచడంలో సహాయపడతాయని నిరూపించబడింది. పరికరాలు అవసరం లేదు, మీరు త్వరలో ఫలితాలను చూస్తారు!",

  ///  Plan Test Description Strings
  'plan_test_desc_1': "కాళ్ళు నిఠారుగా మరియు మోకాలు దగ్గరగా ఉన్నప్పుడు చీలమండల మధ్య దూరం 1.5 సెం.మీ కంటే ఎక్కువ.\n\nనాక్-మోక్ OS ఒక పరిస్థితి, దీనిలో మోకాలు కోణం మరియు కాళ్ళు నిఠారుగా ఉన్నప్పుడు ఒకదానికొకటి తాకింది.",
  'plan_test_desc_2': "మీ పాదాలు దగ్గరగా ఉన్నప్పుడు మీ మోకాళ్ల మధ్య దూరం 3 సెం.మీ కంటే ఎక్కువ.\n\nబౌలెగ్స్ మోకాలి వద్ద బాహ్య వంగి ద్వారా గుర్తించబడతాయి, అంటే తొడల అక్షానికి సంబంధించి దిగువ కాలు లోపలికి కోణం ఉంటుంది, మొత్తం ఆర్చర్ విల్లు యొక్క రూపాన్ని అవయవానికి ఇస్తుంది.",

  ///  Plan Short Description Strings
  'plan_short_desc_5': "ఈ సెషన్‌లోని వ్యాయామాలు మీ శరీరంలోని ప్రతి కండరాన్ని నిమగ్నం చేస్తాయి, మీ వ్యాయామ ఫలితాన్ని పెంచుతాయి మరియు మీ మొత్తం ఫిట్‌నెస్‌ను మెరుగుపరుస్తాయి.",
  'plan_short_desc_6': "అన్ని కోణాల నుండి మీ బట్ మరియు కాళ్ళను లక్ష్యంగా చేసుకోండి, మీరు అనుకున్నదానికంటే చక్కని ఆకారపు కొల్లగొట్టడం మరియు సన్నని కాళ్ళను వేగంగా పొందడానికి మీకు సహాయపడుతుంది!",
  'plan_short_desc_7': "కనిపించే మంచి అబ్స్ అని కోరుకునేవారికి. బిగినర్స్ మరియు వర్కౌట్ వారియర్స్ రెండింటికి సరిపోతుంది.",
  'plan_short_desc_8': "శీఘ్ర చేయి కొవ్వు బర్న్! మీ శరీర బరువుతో స్లిమ్ మరియు మీ చేతులను చెక్కండి!",
  'plan_short_desc_9': "శక్తితో మేల్కొలపండి, మీ శరీరాన్ని రోజుకు ప్రాధమికం చేయండి.",
  'plan_short_desc_10': "మీరే విశ్రాంతి తీసుకోండి మరియు అధిక-నాణ్యత నిద్ర పొందండి.",
  'plan_short_desc_11': "7 నిమిషాల వ్యాయామం మహిళలకు వక్రతలు పొందడానికి ప్రత్యేకంగా డిజైన్ చేస్తుంది. ఈ వ్యాయామం మీ బట్, బొడ్డు, కాళ్ళు మొదలైనవాటిని కవర్ చేస్తుంది.",
  'plan_short_desc_12': "అత్యంత ప్రభావవంతమైన పూర్తి శరీర వ్యాయామాలు! ఫ్లాట్ బొడ్డు, రౌండర్ బూటీ మరియు టోన్డ్\nకాళ్ళతో మరింత ఆకర్షణీయమైన శరీరాన్ని పొందటానికి రోజుకు కేవలం 7 నిమిషాలు తీసుకోండి.",
  'plan_short_desc_13': "కండరాలను విప్పు మరియు నొప్పులను తగ్గించండి",
  'plan_short_desc_14': "బరువు తగ్గడానికి సప్పర్ సమర్థవంతమైన తీవ్రమైన వ్యాయామం. మీరు రోజంతా కేలరీలను బర్న్ చేయవచ్చు!",
  'plan_short_desc_15': "ACSM పరిశోధన ఆధారంగా రూపొందించబడింది, ఫిట్‌నెస్ మరియు ఆరోగ్యాన్ని మెరుగుపరచడానికి నిరూపించబడింది.",
  'plan_short_desc_16': "కొవ్వు దహనం కోసం అత్యంత ప్రభావవంతమైన వ్యాయామం. అధిక తీవ్రత\nవర్కౌట్స్ తరువాత 30 నిమిషాలు జీవక్రియ రేటును రెట్టింపు చేయండి! 4\nనిమి మాత్రమే, సాకులు లేవు!",
  'plan_short_desc_17': "మీ పూర్తి శరీరం కోసం ఈ అధిక-తీవ్రత వ్యాయామం,\nఏరోబిక్ వ్యాయామంతో కలిపి, విక్టోరియా సీక్రెట్\nమోడల్ లాగా, ఆకృతిలో ఉండటానికి మీకు సహాయపడుతుంది!",
  'plan_short_desc_18': "100 కాల్ కేవలం 10 నిమిషాల్లో బర్న్ చేయండి! అధిక తీవ్రమైన వ్యాయామంతో సామర్థ్యాన్ని పెంచుకోండి.",
  'plan_short_desc_19': "శీఘ్ర మరియు ప్రభావవంతమైన. కేవలం 1 0 నిమిషాలు కేలరీల బర్న్\nను గరిష్టీకరించండి మరియు ఈ అధిక తీవ్రత కలిగిన వ్యాయామంతో మీ పూర్తి శరీరానికి శిక్షణ ఇవ్వండి.",
  'plan_short_desc_20': "అల్టిమేట్ హై ఇంటెన్సిటీ వర్కౌట్స్ మిమ్మల్ని మరింత బర్న్ చేసేలా చేస్తుంది\nకేలరీలు! అనుభవజ్ఞులైన వ్యాయామం\nయోధుల కోసం క్రూరమైన కొవ్వు బర్నింగ్ శిక్షణ.",
  'plan_short_desc_21': "మీ కొల్లగొట్టడాన్ని లక్ష్యంగా చేసుకోండి, మీ సెక్సీ వక్రతలను పెంచడానికి తొడ టోనింగ్ వ్యాయామాన్ని కలపండి.",
  'plan_short_desc_22': "జంపింగ్ లేదు! మీ కాళ్ళను రూపొందించడానికి తక్కువ ప్రభావ వ్యాయామం. శబ్దం మరియు అపార్ట్మెంట్ స్నేహపూర్వకంగా లేదు.",
  'plan_short_desc_23': "బ్రెజిలియన్ బట్ ఇకపై కల కాదు! సెక్సియర్, రౌండర్ మరియు పెద్ద కొల్లగొట్టడానికి అన్ని కోణాల నుండి మీ బట్\nను ఉత్తేజపరచండి.",
  'plan_short_desc_24': "3 నిమిషాల తక్షణ వ్యాయామం మాత్రమే! మీ క్రేజీ-బ్యూస్ షెడ్యూల్ ఉన్నప్పటికీ చక్కగా కనిపించే బట్ స్కోర్ చేయండి, మీ విచ్ఛిన్న సమయాన్ని ఉపయోగించుకోండి!",
  'plan_short_desc_25': "తొడ గ్యాప్ కావాలా? లక్ష్య వ్యాయామాలు లోపలి తొడ కొవ్వును కాల్చడానికి సహాయపడతాయి. బిగినర్స్ ఫ్రెండ్లీ!",
